import React from 'react';

import { withRouter } from 'react-router-dom';
import { connect } from "react-redux";

export default class Number extends React.Component {

    constructor(props) {
        super(props);
        number = null;
    }

    number = randomNb(101);

}

function randomNb(max) {
    return Math.floor(Math.random() * max);
}
